<area shape="rect" id="id1" href="End.html" title="End is a final pseudo-state with only inputs and no outputs indicating completion of a flow. " alt="" coords="789,1337,843,1393"/>
<area shape="rect" id="id2" href="Join.html" title="Join is a pseudo-state which merges flow parallel execution branches. " alt="" coords="1096,1337,1151,1393"/>
<area shape="rect" id="id3" href="Fork.html" title="Fork is a pseudo-state which splits flow elements execution into parallel branches. " alt="" coords="1339,1337,1395,1393"/>
<area shape="rect" id="id4" href="Start.html" title="Start is an initial pseudo-state with only outputs and no inputs indicating start of a flow. " alt="" coords="696,1337,753,1393"/>
<area shape="rect" id="id5" href="Choice.html" title="Choice is a conditional pseudo-state." alt="" coords="878,1337,949,1393"/>
<area shape="rect" id="id6" href="InputPin.html" title="Input is a pseudo-state displayed as a square on the border of the containing parition flow through which calls initiate the flow. " alt="" coords="984,1337,1061,1393"/>
<area shape="rect" id="id7" href="ExitPoint.html" title="Exit point is a pseudo-state displayed as a crossed circle on the border of the containing partition flow through which transitions leave the flow. " alt="" coords="1713,1337,1792,1393"/>
<area shape="rect" id="id8" href="Package.html" title="Package is a container of sub-packages, flows, resources, participants, and artifacts." alt="" coords="1179,273,1259,329"/>
<area shape="rect" id="id9" href="Activity.html" title="Activity describes something performed by a participant." alt="" coords="369,1119,450,1179"/>
<area shape="rect" id="id10" href="Resource.html" title="Something that is used by participants for completion of flow elements. " alt="" coords="1080,596,1166,652"/>

<area shape="rect" id="id12" href="EntryPoint.html" title="Entry point is a pseudo-state displayed as a circle on the border of the containing partition flow through which transitions enter the flow. " alt="" coords="1591,1337,1678,1393"/>
<area shape="rect" id="id13" href="CallEntry.html" title="Mapping of a call key to a call. " alt="" coords="32,1223,113,1292"/>
<area shape="rect" id="id14" href="ExpansionInput.html" title="Expansion input is a pseudo-state which can be used instead of partition start pseudo-state to indicate that the partition flow input is a collection and the flow is executed for each element in the collection." alt="" coords="1186,1337,1303,1393"/>
<area shape="rect" id="id15" href="ActivityEntry.html" title="Mapping of activity key to an activity or a flow. " alt="" coords="839,589,933,659"/>
<area shape="rect" id="id16" href="ArtifactEntry.html" title="A mapping of an artifact key to an artifact. " alt="" coords="2040,1674,2135,1743"/>
<area shape="rect" id="id17" href="Service.html" title="Service is a reference to a shared activity used in multiple flows. " alt="" coords="565,1330,661,1399"/>
<area shape="rect" id="id18" href="Flow.html" title="Flow is a composite activity. " alt="" coords="279,1330,377,1399"/>
<area shape="rect" id="id19" href="ExpansionOutput.html" title="Expansion output is a pseudo-state which can be used instead of partition end pseudo-state to indicate that the partition flow output is a collection and the output transitions are executed for each element in the collection." alt="" coords="1430,1337,1556,1393"/>

<area shape="rect" id="id21" href="Participant.html" title="Something that participates in completion of flow elements - a human, an organization, a system. " alt="" coords="1374,758,1478,827"/>
<area shape="rect" id="id22" href="PackageEntry.html" title="Mapping of a sub-package key to a sub-package. " alt="" coords="973,421,1080,490"/>

<area shape="rect" id="id24" href="ResourceEntry.html" title="Mapping of resource key to a resource. " alt="" coords="1115,421,1228,490"/>
<area shape="rect" id="id25" href="TransitionEntry.html" title="Mapping of an output key to a transition. " alt="" coords="482,1116,596,1185"/>
<area shape="rect" id="id26" href="ParticipantEntry.html" title="Mapping of a participant key to a participant. " alt="" coords="1238,589,1355,659"/>
<area shape="rect" id="id27" href="Relationship.html" title="Relationship between artifacts. " alt="" coords="1847,1822,1949,1905"/>
<area shape="rect" id="id28" href="Call.html" title="Call is a specialization of transition which has blocking request-reply semantics where the calling flow element waits for a response from the callee. " alt="" coords="187,1674,313,1743"/>
<area shape="rect" id="id29" href="RelationshipEntry.html" title="Mapping of relationship keys (qualifiers) to a relationships. " alt="" coords="1833,1674,1962,1743"/>

<area shape="rect" id="id32" href="RepresentationEntry.html" title="Mapping of representation key to a representation (diagram). " alt="" coords="1899,259,2043,342"/>
<area shape="rect" id="id33" href="Artifact.html" title="Input to a flow element, e.g. activity, or an output from a flow element. " alt="" coords="1885,1485,2014,1596"/>
<area shape="rect" id="id34" href="ArtifactParticipantResponsibility.html" title="Responsibility assignments for an artifact at the activity level if different from the activity responsibility assignments." alt="" coords="1636,1109,1840,1192"/>

<area shape="rect" id="id36" href="PackageElement.html" title="Base class for elements which can be contained in a package and as such inherited, overridden, and suppressed." alt="" coords="1679,38,1820,181"/>
